import { popinfo } from '../../components/search-collection/popinfo';

class PopSearchPage extends Component {
	constructor() {
		super()
		this.state = {
			poplist: []
		}
	}

	componentDidMount() {
		this.setState({ poplist: poplist})
	}

	render() {
		return(
			<div>
				<h1>Pop Music Search</h1>
				<SearchBox />
				<CardList info={ poplist } />
			</div>
		);

	}
}


